import React, { Component } from 'react'
import {Button, Form } from 'react-bootstrap'

export default class Submit extends Component {
    constructor(props){
        super(props)
        this.state = {
            makeTodo: ""
        }
    }


    render() {
        return (
            <div>
            <Form>
                <Form.Group>
                    <Form.Control type="text" placeholder="Enter Todo" value={this.state.makeTodo} onChange = {this.handleTodoChange} />
                </Form.Group>
                <Button variant="primary" type="submit">Make Todo</Button>
            </Form>
        </div>
        )
    }
}
